            this.marrDefoultValueGridData[this.mnumLineItemRowIndex].TargetScreen = pobjEvent.value.Leftpanename;
            this.marrDefoultValueGridData[this.mnumLineItemRowIndex].User1 = pobjEvent.value.RoutingPath;
