  bmlfSaveProductData() {
    this.mbIsLoading = true;
    this.marrDefoultValueGridData.forEach(element => {
      if (element.Module == '') {
        element.Module = this.DillDownHeaderModel.Module;
      }
      if (element.Screen == '') {
        element.Screen = this.DillDownHeaderModel.Screen;
      }
      if (element.KeyValue1 == '') {
        element.KeyValue1 = this.DillDownHeaderModel.KeyValue1;
      }
      if (element.KeyValue2 == '') {
        element.KeyValue2 = this.DillDownHeaderModel.KeyValue2;
      }
      if (element.ScreenOption == '') {
        if (this.StardandScreem == true) {
          element.ScreenOption = 'Standard';
        } else {
          element.ScreenOption = 'Custom';
        }
      }
      if (element.FieldType == '') {
        if (this.StardandField == true) {
          element.FieldType = 'Standard';
        } else {
          element.FieldType = 'Custom';
        }
      }
    });
    let pobjJData = {
      HeaderData: this.marrDefoultValueGridData,
      Response: [{
        "ResponseText": "",
        "ErrorCode": ""
      }]
    };
    let pobjJson = {
      JSON: JSON.stringify(pobjJData)
    };
    this.formService.bmlfSaveDrillDown(pobjJson, this.msFormMode).subscribe(res => {
      this.mbIsLoading = false;
      if (res.Response[0].ErrorCode == "") {
        this.mbIsChangeData = false;
        if (this.msFormMode == "I") {
          this.msFormMode = "U";
          this.msCopyRecord = "N";
          // let param = { Module: res.HeaderData[0].Module, Screen:  res.HeaderData[0].Screen,  KeyValue1:  res.HeaderData[0].KeyValue1 , KeyValue12:  res.HeaderData[0].KeyValue2 };
          // this.utilService.bmgfRefreshReuse('/main/customization/dilldown-master/manage', true, param);
          // this.mobjDillDownModel.DocumentGroup = res.HeaderData[0].DocumentGroup;
          // this.msPrdKey = this.mobjDillDownModel.DocumentGroup;
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.SAVE"));
        } else if (this.msFormMode == "U") {
          this.toastMessageService.notifySuccess(this.utilService.bmgfonTranslate("COMMON.MSG.EDIT"));
        }
        if (this.mbIsSearchMode) {
          this.mbIsSearchMode = false;
          this.bmlfOpenLookupModal('DrillDownMasterList', this.msScreenName, 'DrillDownMasterList', 'click', '', 'custom', 'cmdSearch', 'DILLDOWN.TITLE');
        } else if (this.mbIsAddMode) {
          this.mbIsAddMode = false;
          this.bmlfRefreshForm();
        } else if (this.mbIsCopyMode) {
          this.mbIsCopyMode = false;
          this.bmlfCopyData();
        } else if (this.mbIsCloseMode) {
          this.mbIsCloseMode = false;
          this.router.navigate(["/main/configuration/document-authorization"]);
        } else {
          this.bmlfGetProductData();
        }
      } else {
        this.mbIsSearchMode = false;
        this.mbIsAddMode = false;
        this.mbIsCopyMode = false;
        this.mbIsDeleteMode = false;
        this.mbIsCloseMode = false;
        this.toastMessageService.notifyError(res.Response[0].ResponseText);
      }
      console.log(res);
    }).add(() => {
      this.mbIsLoading = false;
    });
  }
